var didScroll;
var lastScrollTop = 0;
var delta = 5;
var navbarHeight = $('#header').outerHeight();
var header = document.getElementById("header");
var sticky = header.offsetTop;

$(window).scroll(function (event) {
    didScroll = true;

    // if(!$('.navbar-toggler.navbar-dark').hasClass('collapsed')){
    //     $('.navbar-toggler.navbar-dark').click();
    // }
});

setInterval(function () {
    if (didScroll) {
        hasScrolled();
        didScroll = false;
    }
}, 250);

function hasScrolled() {


    var st = $(this).scrollTop();

    if (Math.abs(lastScrollTop - st) <= delta)
        return;
    if (st > lastScrollTop && st > navbarHeight) {
        // Scroll Down

        $('header').removeClass('nav-down').addClass('nav-up');
    } else {
        // Scroll Up

        if (st + $(window).height() < $(document).height()) {
            $('header').removeClass('nav-up').addClass('nav-down');
        }
        if (window.pageYOffset > sticky && $(this).scrollTop() > 180) {
            header.classList.add("sticky");
            // if ($(window).width() > 800) {
            //     if (location.pathname != "/services/podcast/")
            //         $('.union-content').css('marginTop', '144px');
            // } else {
            //     if (location.pathname != "/services/podcast/")
            //         $('.union-content').css('marginTop', '118px');
            // }

        } else {
            header.classList.remove("sticky");
            $('.union-content').css('marginTop', '0');
        }
    }

    lastScrollTop = st;
}


/* End */
